import './App.css';
import SpotifyEmbed from './components/SpotifyEmbed';
function App() {
  const trackURI = 'spotify:track:6rqhFgbbKwnb9MLmUQDhG6';
  return (
    <div className="App">
      <h1>Spotify Embed Example</h1>
      <SpotifyEmbed trackURI={trackURI} />
    </div>
  );
}

export default App;
